pub enum Error {
    UnexpectedToken {
        token: String,
        found: String,
    },
    Custom {
        field: String,
    },
    UnsupportedOperation {
        operation: String,
    },
    Io {
        source: ::std::io::Error,
    },
    FromUtf8Error {
        source: ::std::string::FromUtf8Error,
    },
    ParseIntError {
        source: ::std::num::ParseIntError,
    },
    ParseFloatError {
        source: ::std::num::ParseFloatError,
    },
    ParseBoolError {
        source: ::std::str::ParseBoolError,
    },
    Syntax {
        source: ::xml::reader::Error,
    },
}
